// ==========================================
// 3. 全量扫描逻辑
// ==========================================
const envProxy = new Proxy({
    get window() { return window; },
    get document() { return document; },
    get navigator() { return navigator; },
    get crypto() { return window.crypto; },
    get console() { return console; },
    get Date() { return Date; },
    // Mock 一些可能导致报错的检测点
    get moduleQimei() { return undefined; },
}, {
    get: (t, p) => t[p] || window[p] || global[p]
});

const mockConfig = {
    config: { instanceId: "id", businessConfig: { platform: "10201" } },
    playerInstanceId: "id",
    logger: { log:()=>{}, error:console.error, warn:console.warn },
    get: function(k) { return this.config[k]; }
};

const input = { anc: "eyJyYyI6IkdxQ2xScU81TXZU" };

(async () => {
    const vmFactory = cy(RAW_BYTECODE);
    const opsArray = vmFactory.ops;
    const len = opsArray.length;
    console.log(`[-] 开始全量扫描入口点 (0 - ${len})...`);
    console.log(`[-] 过滤策略: 首指令必须是 [26, 76, 51, 81] 之一`);
    
    // 候选入口指令集：这些指令通常用于函数开头的变量初始化
    // 26: Load Constant (Push)
    // 76: New Object {}
    // 51: New Object ()
    // 81: Push Const?
    const VALID_START_OPS = new Set([26, 76, 51, 81]);
    
    // 并行测试的候选列表
    const candidates = [];
    
    for (let i = 0; i < len - 10; i++) {
        const firstOp = opsArray[i + 1]; // VM 中 switch 使用 o[++d]，所以 Opcode 是 d+1
        
        if (VALID_START_OPS.has(firstOp)) {
            candidates.push(i);
        }
    }
    
    console.log(`[-] 找到 ${candidates.length} 个潜在入口，开始试运行...`);
    
    for (let i = 0; i < candidates.length; i++) {
        const entry = candidates[i];
        
        // 每 100 个打印一次进度
        if (i % 100 === 0) process.stdout.write(`\r[Running] Progress: ${i}/${candidates.length} (Entry: ${entry})  `);
        
        try {
            const runner = vmFactory.runner(entry, [], envProxy);
            // 尝试运行，捕获所有异常
            // 使用 call 传入 mockConfig
            const resultPromise = runner.call(mockConfig, input);
            
            // 简单的同步检测：如果它是个 Promise，我们 race 它
            // 如果是同步返回（有些 VM 版本是同步的），直接拿结果
            let result = resultPromise;
            if (resultPromise instanceof Promise) {
                 // 给 50ms 超时，快速过
                 result = await Promise.race([
                     resultPromise, 
                     new Promise((_, r) => setTimeout(() => r("TIMEOUT"), 50))
                 ]);
            }
            
            if (result && result.anc && result.anc !== input.anc) {
                console.log(`\n\n🎉🎉🎉 成功找到入口点: ${entry} 🎉🎉🎉`);
                console.log("解密结果:", JSON.stringify(result, null, 2));
                return; // 结束程序
            }
        } catch (e) {
            // 忽略报错，继续下一个
        }
    }
    
    console.log("\n\n[-] 扫描结束，未找到有效入口。");
    console.log("[-] 建议：请在浏览器控制台断点调试，查看 cy() 调用的第一个参数。");
})();